pragma solidity ^0.8.8;

contract if_elseBlockchain{

    // if else ka use contract level per use nahi kar sakte hai 

    function fun(uint _x) public pure returns(string memory){
        string memory val;

        if(_x>100){
            val = "greater than 100";
        }
        else if(_x<100){
            val = "smaller than 100";
        }
        else{
            val = "equal to 100";
        }

        return val;

    }
}

